import logo from "../images/logo.png";
import styles from "../styles/Menu.module.css";

function Menu() {
  return (
    <div className={styles.image}>
      <img className={styles.image} src={logo} alt="logo"></img>
      <div className={styles.menuItems}>
        <div>Home</div>
        <div>Contact Us</div>
      </div>
    </div>
  );
}

export default Menu;
